import React from "react";
const Button = ({ id, onClickNext, onClickPrevious }) => {
  if (id > 0 && id < 10)
    return (
      <div>
        <button
          type="button"
          className="btn btn-primary"
          onClick={() => onClickPrevious()}
        >
          Previous
        </button>
        <button
          type="button"
          className="btn btn-primary"
          onClick={() => onClickNext()}
        >
          Next
        </button>
      </div>
    );
  else if (id === 10)
    return (
      <div>
        <button
          type="button"
          className="btn btn-primary"
          onClick={() => onClickPrevious()}
        >
          Previous
        </button>
        <a href="/yourScore">
          <button type="button" className="btn btn-primary">
            Submit
          </button>
        </a>
      </div>
    );
};

export default Button;
